import React, { useState } from "react";
import { Card, CardHeader, CardTitle, CardDescription, CardContent, CardFooter } from '../components/ui/card';
import { useNavigate } from "react-router-dom";

const MyBusiness = () => {
  const [businesses, setBusinesses] = useState([
    { id: 1, name: "Restaurant A", description: "A great place for food!" },
    { id: 2, name: "Cafe B", description: "Coffee and snacks all day!" },
  ]);

  const navigate = useNavigate();

  const handleCreateBusiness = () => {
    navigate("/business-form"); // Navigate to the Business Form page
  };

  return (
    <div className="container mx-auto p-4">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-semibold">My Businesses</h1>
        <button
          onClick={handleCreateBusiness}
          className="bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700"
        >
          Create New Business
        </button>
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        <h2>Your Businesses</h2>
        {businesses.map((business) => (
          <Card key={business.id}>
            <CardHeader>
              <CardTitle>{business.name}</CardTitle>
              <CardDescription>{business.description}</CardDescription>
            </CardHeader>
            <CardContent>
              <p>Additional business details...</p>
            </CardContent>
            <CardFooter>
              <button className="text-blue-600 hover:text-blue-700">Edit</button>
            </CardFooter>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default MyBusiness;
